          </div>
        </div>

        <div class="col-12 lightbrownCartBackground   mt-3 cartText">
          <div class="col-12 pushToRight lightbrownCartBackground">
            <NavLink to="/Cart/Checkout" className="pr-3">
              <img src={Back} class="pb-4 pt-1" alt=""></img>
            </NavLink>
            <NavLink to="/Cart/StepFour" className="pr-3">
              <img src={Purchase} class="pb-4 pt-1" alt=""></img>
            </NavLink>
          </div>
        </div>
      </section>
    </main>
  );
};
